import React from "react";

function App(props) {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img className="circle-img"
            src={props.image}
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p>{props.number}</p>
          <p>{props.mail}</p>
        </div>
      </div>
    </div>
  );
}

export default App;
